import React from 'react'
import '../component/Menu.css'
import { Link } from 'react-router-dom'

const Menu = () => {
    return (
        <div className="Menu">
            <ul>
                <li><Link to="/">HOME</Link></li>
                <li>ABOUT</li>
                <li>CONTACT</li>

            </ul>




             
             
         <Link to="contact">CONTACT</Link> 


        </div>
    );
}
export default Menu;
